	/* 
	 Given is the function f(x) = [2^(30.403243784-x^2)] x 10^-9 ( [ ]  is the floor-function),
	the sequence un is defined by u0 = -1 and un+1 = f(un).

	Find u(n) + u(n+1) for n = 10^12.
	Give your answer with 9 digits after the decimal point.

	*/

	// NOTE:  At 518, it starts repeating two results: 0.681174932 + 1.029462926 = 1.710637858  BUT!!! this is not the answer Euler is looking for
	
	class Problem197
	{
		public static double ten9 = Math.Pow(10, -9);
		public static long ten12 = (long)Math.Pow(10, 12);
		public static void Solve()
		{
			double un = -1;
			Double un1 = f(un);
			for(long i = 1; i <= ten12; i++)
			{
				un = un1;
				// NOTE:  At 518, it starts repeating two results: 0.681174932 + 1.029462926 = 1.710637858  BUT!!! this is not the answer Euler is looking for			
				Console.Write("{0,3}: ",i);
				un1 = f(un1);
			}
			Console.WriteLine(un);
			Console.WriteLine(un1);
			Console.WriteLine(un1 + un);
		}

		public static double f(double un)
		{
			double unSquared = un * un;//Math.Pow(un, 2);
			double thirtyMinus = 30.403243784f - unSquared;
			double interim = Math.Pow(2, thirtyMinus);
			double floored = Math.Floor(interim);
			double result = floored*ten9;
			Console.WriteLine("unSquared= {0:F9} thirtyMinus= {1:F9} interim= {2,20:F9} floored= {3,20:F9} result= {4:F9}",
				unSquared, thirtyMinus, interim, floored, result);
			return result;
			return ten9 * Math.Floor(Math.Pow(2, (30.403243784 - Math.Pow(un, 2))));
		}

